import React from 'react';
import bannerImg from '../img/banner.webp';

const Banner = () => {
	return (
			<section className='banner'>
				<div className="container">
					<div className="banner__inner">
						<div className='banner__img-box'>
							<a href="/" className='banner__img-link'>
								<img className='banner__img' src={bannerImg} alt="current website"/>
							</a>
						</div>
						<div className='banner__content'>
							<p>Lorem ipsum dolor sit amet.</p>
							<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ipsam, velit.</p>
							<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ipsam, velit.</p>
							<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ipsam, velit.</p>
							<p>Lorem ipsum.</p>
						</div>
					</div>
				</div>
			</section>
	);
};

export default Banner;
